import { Button, Fade } from '@mui/material';
import Modal from '@mui/material/Modal';
// import{makeStyles} from "@mui/styles"
import React, { useState, useContext } from 'react';
// import { MyContext, userData } from "../Context2"
import Select, { MultiValue } from 'react-select'
import IDay from '../types/day.type';
// import MultiValue from 'react-select/dist/declarations/src/components/MultiValue';

interface Props {
    daysFromParent: IDay[]
    choiceNames: {
        value: number,
        label: string
    }[],
    currentfilter: {
        value: number,
        label: string
    }[],
    
    myCallBack: (days: Array<IDay>) => boolean//(days: Array<IDay>) => {null}
}

type State = {
    // user: {
    //     userName: string
    //     loggedIn: boolean
    // },
    isOpen: boolean
    selectChoices: Array<IDay>
    // choiceNames: {
    //     value: number,
    //     label: string
    // }[]
}

export default class SetFilter extends React.Component<Props, State>{
    constructor(props: Props) {
        super(props);
        this.state = {
            // user: {
            //     userName: userData.user.userName,
            //     loggedIn: userData.user.loggedIn
            // },
            isOpen: false,
            selectChoices: [],

        }
    }

    handleButton = (e) => {
        e.preventDefault();
        this.props.myCallBack(this.state.selectChoices);
        this.closeModal();
    }
    // handleReturn = (e) => {
    //     const data = "ok";//e.target.elements.option.value.trim();
    //     if (!data) {
    //         this.setState(() => ({
    //             user: {
    //                 userName: "ErrorUser",
    //                 loggedIn: false
    //             }
    //         }));
    //     }
    //     else {
    //         // this.props.testr = "#2";s
    //         // let  data1 = this.props.testr as string
    //         console.log("Pre:  ");

    //         this.closeModal();
    //         console.log(this.props.testr);
    //     }
    // }
    openModal = () => this.setState({ isOpen: true });
    closeModal = () => this.setState({ isOpen: false });
    
    changeContext = () => {
        this.setState(state => ({
            // user: {
            //     userName: this.state.user.userName === userData.user.userName ? userData.user.userName : "NewUser",
            //     loggedIn: this.state.user.loggedIn === true ? false : true,
            // }

        }))
        //)
        // console.log(userData.user.userName)
        // userData.user.userName = "after2";
    }
    componentDidMount() {
        return 
    }
    isInArray(element, index, array) 
    {  
        
        return (element % 2 == 1);  
    }   
    setSelectChoice(theChoices: MultiValue<{ value: number, label: string }>) {
        const tmpArray = new Array<string>;
        // let tmpChoichesDays = new Array<IDay>;
        const theDays2 = this.props.daysFromParent;
        console.log("Values changed")
        console.log(theChoices)
        theChoices.map((item) => {
            tmpArray.push(item.label)
        })

        // tmpChoichesDays = theDays2;
        // Driver code
        
        const evenMoreArrays :IDay[] = [];
        // evenMoreArrays = [];
        // check for odd number 
        theChoices.forEach(function (value, label){
            console.log(value.label);
            console.log(value.value);
            const nameMatch = theDays2.find(item => item.name == value.label ); 
            if(nameMatch)
                {
                    console.log("Match! -> "+nameMatch.name)
                    evenMoreArrays.push(nameMatch);
                }

            // for ( const  datas  in theChoices) {
                
                // if (theChoices.hasOwnProperty(label)) {
                    
                    console.log("Weird" + value.label );
                    theDays2.filter(function(){

                     
                     return {
                     key: value.value,
                     name:value.label}
                    });
                // console.log(myObject);
                
                
            })
            this.setState({
                    selectChoices:evenMoreArrays
                    // selectChoices[dataRef.key();]: tmpArray
                })
                
                // }
        
    }

    setUser() {
        // componentDidUpdate(prevProps: Readonly<{}>, prevState: Readonly<{}>, snapshot?: any): void {
        //      const uvar = this.context;
        //     console.log("uvar")
        //     console.log(uvar)
        // }
        useContext
    }
    render() {
        const theUser = this.context as any;
        // const  fromParent : tempChoice = []; 
        const options = this.props.choiceNames;
        // const selected = this.props.currentfilter;

        return (
            <>
                {/* 
                <div className="d-flex align-items-center justify-content-center"
                    style={{ height: "2vh" }}
                > */}
                    {/* {this.props.testr()} */}
                {/* </div> */}
                <Button onClick={this.changeContext}>Context</Button>
                <Button  hidden={this.props.daysFromParent.length === 0} onClick={this.openModal}>Open filters</Button>
                <Modal
                    open={this.state.isOpen} onClose={this.closeModal}>
                {/* <Fade in={this.state.isOpen}> */}
                       {/* <ModalChild/> */}
                       <div className="filterDays">
                            <h2>Animated React Modal</h2>
                            <p>
                                {/* 1{theUser.userName} - {theUser.loggedIn}
                                2{this.state.user.userName} - {this.state.user.loggedIn} */}
                            </p>
                            
                            {/* Data:
                            {
                                this.props.daysFromParent.map((day, index) => {
                                    { fromParent.push({ value: index, label: day.name }) }
                                    <p key={"b" + day.key}>{day.name} </p>
                                })

                            } */}
                            <p>Select:</p>
                            <Select isMulti  options={this.props.choiceNames} 
                            // value={selected} 
                            onChange={(choices: MultiValue<{
                                value: number,
                                label: string;
                            }>) => { this.setSelectChoice(choices) }} />
                            {/* //defaultValue={options[0]}/>
                            <p>
                                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi accumsan odio enim.
                            </p>
                            {/* <MyContext.Consumer>
                                {({ user }) => (
                                    <div>
                                        <button
                                            onClick={this.setUser}
                                        >
                                            Toggle Theme
                                        </button>
                                        {user}
                                    </div>
                                )}
                            </MyContext.Consumer> */}
                            <Button onClick={this.handleButton}>Return data</Button>
                        </div>
                    {/* </Fade> */}
                    {/* <Box>
                        Woohoo, you're reading this text in a modal!
                    </Box> */}

                </Modal>
            </>
        )
        // SetFilter.contextType = MyContext;
    }
}
